import React from 'react';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link
} from 'react-router-dom';

function App() {
  return (
    <div>
      {/* <Background/> */}
      <div>
        <Router>
          <div>
            <nav>
              <ul>
                <li>
                  <Link to="/">Home</Link>
                </li>
                <li>
                  <Link to="/test">Test</Link>
                </li>
              </ul>
              <Switch>
                <Route exact path="/">
                  <Home/>
                </Route>
                <Route path="/test">
                  <Test/>
                </Route>
              </Switch>
            </nav>
          </div>
        </Router>
      </div>
      <div>
        {/* <Modal/> */}
      </div>
    </div>
  )
}

function Home() {
  console.log('home')
  return (
    <div>
      Home
    </div>
  )
}

function Test() {
  console.log('test')
  return (
    <div>
      Test
    </div>
  )
}

export default App;
